#include "../myimplement/lzss.c"
#include <sys/time.h>

void printByteArray(char *prefix, ByteArray *byteArray) {
    printf("\n%s[", prefix);
    for (size_t i = 0; i < byteArray->size; i++) {
        // printf("%02X", byteArray->bytes[i]);
        if (i == 0) {
            printf("%d", byteArray->bytes[i]);
        } else {
            printf(", %d", byteArray->bytes[i]);
        }
    }
    printf("]");
}

void testCompression(const char *hexString) {
    // hexString -> byteArray
    printf("\nhexString: ");
    ByteArray *byteArray = hexStringToByteArray(hexString);
    for (size_t i = 0; i < byteArray->size; i++) {
        printf("%02X ", byteArray->bytes[i]);
    }
    printByteArray("byteArray: ", byteArray);
    printf("\nbyteArray size：%d byte", byteArray->size);

    // encode
    struct timeval start, end;
    gettimeofday(&start, NULL);
    ByteArray *encodeResult = encode(byteArray);
    gettimeofday(&end, NULL);
    double time_used = (end.tv_sec - start.tv_sec) * 1000 + (end.tv_usec - start.tv_usec) / 1000.0;
    printf("\n压缩耗时: %f ms", time_used);
    printf("\n压缩后的十六进制字符串：%s", byteArrayToHexString(encodeResult));
    printByteArray("压缩后的 byteArray: ", encodeResult);

    // decode
    gettimeofday(&start, NULL);
    ByteArray *decodeResult = decode(encodeResult);
    gettimeofday(&end, NULL);
    time_used = (end.tv_sec - start.tv_sec) * 1000 + (end.tv_usec - start.tv_usec) / 1000.0;
    printf("\n解压耗时: %f ms", time_used);
    printByteArray("解压后的 byteArray: ", decodeResult);
    if (strcmp(byteArray->bytes, decodeResult->bytes) == 0) {
        printf("\n解压后一致");
    } else {
        printf("\n解压后不一致");
    }

    freeByteArray(byteArray);
    freeByteArray(encodeResult);
    freeByteArray(decodeResult);
    printf("\n=============================================");
}

void writeFile(const char *hexString, char *fileName) {
    FILE *outfile = fopen(fileName, "wb");

    // hexString -> byteArray
    printf("\nhexString -> byteArray: ");
    ByteArray *byteArray = hexStringToByteArray(hexString);
    for (size_t i = 0; i < byteArray->size; i++) {
        printf("%02X ", byteArray->bytes[i]);
        if (fputc(byteArray->bytes[i], outfile) == EOF) {
            printf("Output error\n");
            exit(1);
        }
    }
    printf("\nbyteArray size：%d byte", byteArray->size);

}

